import "./ExpenseForm.css";
const ExpenseForm = () => {
  return (
    <div className="new-expense__controls">
      <form>
        <div className="new-expense__control">
          <label>title</label>
          <input type="text" />
        </div>
        <div className="new-expense__control">
          <label>Amount</label>
          <input type="number" />
        </div>
        <div className="new-expense__control">
          <label>Date</label>
          <input type="date" />
        </div>
      </form>
    </div>
  );
};
export default ExpenseForm;
